import styled from 'styled-components';

const Hello = styled.p`
  font-size: 30px;
  color: palevioletred;
`
const Wrapper = styled.div`
  font-size: 30px;
  color: palevioletred;
`
const Header = styled.header`
  height: 100px;
  background-color: papayawhip;
  padding: 5px;
  display:flex;
  align-items: center;
  justify-content: space-around;
`

const AppLogo = styled.img`


`

class App extends Component {

  render() {
    return (
      <Wrapper>
        <Header>
          <Hello>
            Shop
          </Hello>

          <Hello>
            Location
          </Hello>
          <Hello>
            Contact
          </Hello>
        </Header>
        <div>Jess</div>
      </Wrapper>
    );
  }
}

export default App;
